import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract product data from the page
    const productData = await page.$$eval('.product-card', cards => 
      cards.map(card => {
        const title = card.querySelector('.product-title')?.textContent || '';
        const price = card.querySelector('.product-price')?.textContent || '';
        const rating = card.querySelector('.product-rating')?.textContent || '';
        return { title, price, rating };
      })
    );

    // Extract user profile links
    const profileLinks = await page.$$eval('a[href="#"]', links => 
      links.map(link => link.textContent?.trim()).filter(text => text && text.includes('Your'))
    );

    // Extract all category links
    const categoryLinks = await page.$$eval('a[href="#"]', links => 
      links.map(link => link.textContent?.trim()).filter(text => text && !text.includes('Your'))
    );

    // Extract search and navigation elements
    const searchInput = await page.$eval('#searchInput', el => el.placeholder);
    const searchBtn = await page.$eval('.search-btn', el => el.tagName);
    const categorySelect = await page.$eval('.search-category', el => el.tagName);

    // Take screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    // Simulate bulk data collection by interacting with multiple elements
    await page.click('#searchInput');
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');

    // Wait for potential search results and take screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_completed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_completed.png'));

    // Extract all visible text content for bulk data simulation
    const allTextContent = await page.$$eval('*', elements => 
      elements.map(el => el.textContent?.trim()).filter(text => text && text.length > 0)
    );

    return {
      success: true,
      action: "Extracted product data, profile links, categories, and performed search simulation",
      extractedData: {
        products: productData,
        profileLinks,
        categories: categoryLinks,
        searchElements: {
          input: searchInput,
          button: searchBtn,
          select: categorySelect
        },
        textSamples: allTextContent.slice(0, 50) // First 50 text samples
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data extraction simulation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
